import React from 'react'

export default class extends React.Component {
  stuff = new Array(100).fill().map((v, i) => {
    return <p key={i}>hi{i}</p>
  })

  render () { return (
    <div class="bg-green-500 py-12 md:p-20">
      <div class="bg-pink-400 mx-2">
        {this.stuff}
      </div>
    </div>
  ) }
}
